import React from 'react';
import ReactDOM from 'react-dom/client';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import App from './App';
import './index.css';
import Header from '../Layout/Header';
import Home from '../Home';
import Footer from '../Layout/Footer';
import SinhvienList from '../SinhVien/SinhvienList';
import SinhvienForm from '../SinhVien/SinhvienForm';
import SinhvienDetail from '../SinhVien/SinhvienDetail';
import BangDiemList from '../BangDiem/BangDiemList';


const MainInterface = () => {
  return (
    <div className="main-interface">
      <Header />
      <Home />
      <Footer />
      <h1>Welcome to the Main Interface</h1>
      <p>Select an option below to navigate:</p>
      <nav>
        <ul>

          <li><Link to="/app">Main Application</Link></li>
          <li><Link to="/app/sinhvien">Student List</Link></li>
          <li><Link to="/app/bangdiem">Grade List</Link></li>
          <li><Link to="/app/add">Add New Student</Link></li>
        </ul>
      </nav>
    </div>
  );
};

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <Router>
      <Routes>
        <Route path="/" element={<MainInterface />} />
        <Route path="/app/*" element={<App />} />
      </Routes>
    </Router>
  </React.StrictMode>
);
